@import "src/styles/variables/color";

nav {
    display: flex;
    justify-content: space-between;
    align-items: center;
    padding: 0 80px;
    min-height: 60px;
    z-index: 99;
}

.logo-container {
    height: 50px;
    width: 50px;
    margin: 10px 0;
    background-color: $primary-color;
    border-radius: 50%;
    display: flex;
    justify-content: center;
    align-items: center;
}

a,
.logo,
.menu-mobile {
    cursor: pointer;
}

.nav-links {
    display: flex;
    justify-content: space-around;
    align-items: center;
    list-style: none;
    margin-bottom: 0;
}

a {
    text-decoration: none;
    font-weight: 600;
    font-size: 1.2em;
    color: $font-alt;
    padding: 0 20px;
}

.link:hover {
    color: $font-primary;
}

.get-started {
    display: flex;
    justify-content: flex-end;
    align-items: center;
    border: 2px solid $primary-color;
    background-color: transparent;
    color: $primary-color;
    font-size: 16px;
    border-radius: 50px;
    text-decoration: none;
    height: 45px;
    padding: 0 16px;
    cursor: pointer;
    transition: 200ms ease-in;
}

.get-started:hover {
    background-color: $secondary-color;
    border-color: $secondary-color;
    color: #fff;
}

.menu-mobile {
    display: none;
    padding: 5px;

    div {
        width: 25px;
        height: 3px;
        margin: 5px;
        background-color: $primary-color;
        transition: all 0.3s ease;
    }
}

@media (max-width: 959px) {
    nav {
        justify-content: space-around;
        top: 0;
        width: 100%;
        padding: 0;
    }

    .nav-links {
        display: none;
        flex-direction: column;
        align-items: center;
        position: absolute;
        right: 0;
        top: 72px;
        height: 92vh;
        width: 100%;
        transform: translateX(100%);
        transition: transform 0.5s ease-in;
        background-color: $background-color;
        z-index: 99;
    }

    li {
        opacity: 0;
    }

    .menu-mobile {
        display: block;
    }

    .nav-active {
        display: flex;
        transform: translateX(0%);
    }
}

@keyframes navLinkFade {
  from {
    opacity: 0;
    transform: translateX(50px);
  }

  to {
    opacity: 1;
    transform: translateX(0px);
  }
}

.toggle .line1 {
  transform: rotate(-45deg) translate(-5px, 6px);
}

.toggle .line2 {
  opacity: 0;
}

.toggle .line3 {
  transform: rotate(45deg) translate(-5px, -6px);
}
